import React from 'react';
import { NavLink } from 'react-router-dom';

const Navbar = () => {
  return (
    <nav className="bg-blue-600 text-white shadow-lg sticky top-0 z-50">
      <div className="container mx-auto flex justify-between items-center p-4">
        {/* Logo */}
        <NavLink to="/" className="text-2xl font-bold flex items-center">
          ðŸš— GarageShare
        </NavLink>

        {/* Links */}
        <div className="flex space-x-6">
          <NavLink
            to="/"
            className={({ isActive }) =>
              `hover:text-gray-200 ${isActive ? 'text-yellow-300' : ''}`
            }
          >
            Inicio
          </NavLink>
          <NavLink
            to="/favorites"
            className={({ isActive }) =>
              `hover:text-gray-200 ${isActive ? 'text-yellow-300' : ''}`
            }
          >
            Favoritos
          </NavLink>
          <NavLink
            to="/add-space"
            className={({ isActive }) =>
              `hover:text-gray-200 ${isActive ? 'text-yellow-300' : ''}`
            }
          >
            Agregar Espacio
          </NavLink>
          <NavLink
            to="/host-dashboard"
            className={({ isActive }) =>
              `hover:text-gray-200 ${isActive ? 'text-yellow-300' : ''}`
            }
          >
            Dashboard
          </NavLink>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
